import React from "react";

const Contact = () => {
  return (
    <div className="h-screen bg-gradient-to-br from-green-500 to-blue-300">
      <div className="home grid grid-cols-2 gap-4 w-[80%] ml-52 pt-20 bg-slate-500">
        <h1 className="col-span-2 text-4xl font-bold text-center">
          Contact me
        </h1>
        <div></div>
      </div>
    </div>
  );
};

export default Contact;
